import React from "react";
import ConflictsColumn from "./ConflictsColumn";

function RentalRow({ rental, updateRental }) {
  const handleChange = (field, value) => {
    updateRental(rental.id, { ...rental, [field]: value });
  };

  return (
    <tr>
      <td>
        <input
          type="text"
          value={rental.name}
          onChange={(e) => handleChange("name", e.target.value)}
          placeholder="Имя арендатора"
        />
      </td>
      <td>Выбрать оборудование</td>
      <td>
        <div>
          <label>Начало:</label>
          <input
            type="date"
            value={rental.startDate}
            onChange={(e) => handleChange("startDate", e.target.value)}
          />
          <input
            type="time"
            value={rental.startTime}
            onChange={(e) => handleChange("startTime", e.target.value)}
            step="1800"
          />
        </div>
        <div>
          <label>Конец:</label>
          <input
            type="date"
            value={rental.endDate}
            onChange={(e) => handleChange("endDate", e.target.value)}
          />
          <input
            type="time"
            value={rental.endTime}
            onChange={(e) => handleChange("endTime", e.target.value)}
            step="1800"
          />
        </div>
      </td>
      <td>
        <input
          type="text"
          value={rental.issuedBy}
          onChange={(e) => handleChange("issuedBy", e.target.value)}
          placeholder="Кто выдал"
        />
      </td>
      <td>
        <input
          type="text"
          value={rental.receivedBy}
          onChange={(e) => handleChange("receivedBy", e.target.value)}
          placeholder="Кто принял"
        />
      </td>
      <td>
        <input
          type="text"
          value={rental.notes}
          onChange={(e) => handleChange("notes", e.target.value)}
          placeholder="Примечания"
        />
      </td>
      <td>{rental.status}</td>
      <td>
        <ConflictsColumn
          startDate={rental.startDate}
          startTime={rental.startTime}
          endDate={rental.endDate}
          endTime={rental.endTime}
        />
      </td>
    </tr>
  );
}

export default RentalRow;
